There are several ways a web application can communicate between two browser tabs:

### 1. **Local Storage**

You can use the `localStorage` API to store data in one tab and retrieve it in another. This method is simple but has limitations, as the data is stored locally and can be cleared by the user.

**Example:**
```javascript
// Tab 1
localStorage.setItem('data', 'Hello from Tab 1!');

// Tab 2
const data = localStorage.getItem('data');
console.log(data); // Output: "Hello from Tab 1!"
```
### 2. **Cookies**

Similar to local storage, you can use cookies to store data in one tab and retrieve it in another. However, cookies have size limitations and can be blocked by users.

**Example:**
```javascript
// Tab 1
document.cookie = 'data=Hello from Tab 1!';

// Tab 2
const cookies = document.cookie.split(';');
const data = cookies.find(cookie => cookie.startsWith('data=')).split('=')[1];
console.log(data); // Output: "Hello from Tab 1!"
```
